import React from "react";
import Jumbo from "./components/Jumbotron";
import Main from "./components/Main";
import Wrapper from "./components/Wrapper";
import Header from "./components/Header";

function App() {
  return (
    <div className="App">
      <Wrapper>
        <Jumbo />
        <Header />
        <Main />
      </Wrapper>
    </div>
  );
}
